INSERT INTO `cpnl_questions` (`qus_id`, `qus_designation`, `qus_parent`, `qus_category`, `qus_type`, `qus_question`, `qus_desc`, `qus_is_togler`, `qus_is_mandatory`, `qus_order`, `qus_status`, `qus_added_by`, `qus_added_on`) VALUES
(41, 8, 0, 1, 4, '<p>പുതിയ ഒരു വണ്ടി എടുക്കാനുള്ള താല്പര്യം എന്താണ് ?<span class=\"redactor-invisible-space\">May I ask you why are you interested in buying a new car/what made you decide to get a new car?</span></p>', '', 0, 1, 33, 1, 0, '2019-05-02 10:40:18'),
(4, 8, 0, 1, 1, '<p>സാർ എന്ത് ചെയ്യുന്നു ?</p>\n<p> What\nare you doing sir/your profession sir?</p>', '<p>[Designation etc ] - ചെയ്യുന്ന കാര്യത്തിന്റെ Full detailsഎടുക്കുക . [Business Area, Staff. etc]</p>', 0, 0, 1, 1, 0, '2019-04-27 10:18:35'),
(5, 8, 0, 1, 1, '<p>സാർ ഏത് വണ്ടിയാണ് ഇപ്പോൾ ഉപയോഗിക്കുന്നത് ? </p><p><span class=\"redactor-invisible-space\">Which\nvehicle are you using?<br></span></p>', '<p>[Brand, Product, Varient]</p>', 0, 1, 33, 1, 0, '2019-04-27 10:20:35'),
(6, 8, 0, 1, 1, '<p>എത്ര വർഷമായിട്ട് ഈ വണ്ടി ഉപയോഗിക്കുന്നുണ്ട് ?</p><p>Howlong have you been using this vehicle?/ How long do you normally keep your vehicles?</p>', '', 0, 0, 40, 1, 0, '2019-04-27 10:21:38'),
(10, 8, 0, 1, 1, '<p>Insurance validity, Insurance Premium, Periodical Service date, Colour, KM, Variant, Registration?</p>', '', 0, 0, 6, 1, 0, '2019-04-27 10:37:47'),
(7, 8, 0, 1, 1, '<p>സാർ പുതിയതായി വാങ്ങിത്തച്ചതാണോ ? അല്ലെങ്കിൽ ഏതാണ് മോഡൽ, സാർ എത്രാമത്തെ Owner ആണ് ?</p><p>Are you buy this one as fresh? If not, what is the model? What is the chronological order of ownership/Ownership?</p>', '', 0, 0, 8, 1, 0, '2019-04-27 10:23:55'),
(9, 8, 0, 1, 1, '<p>നിലവിൽ ഈ വാഹനത്തിൻറെ Condition  ?</p><p>Current condition of the vehicle/Is there any claim or replacement for this one/<strong> </strong>What type of repairs did you have to do on your old car?<br></p>', '<p>[Claim , any works]</p>', 0, 0, 7, 1, 0, '2019-04-27 10:36:44'),
(11, 8, 0, 1, 1, '<p>ഈ വാഹനത്തിൽ സാർ തൃപ്തനാണോ ? അല്ലെങ്കിൽ എന്ത് കൊണ്ട് ?</p><p><span class=\"redactor-invisible-space\">Are you satisfied with this\nvehicle? If not, Why?<br></span></p>', '', 0, 0, 9, 1, 0, '2019-04-27 10:40:15'),
(12, 8, 0, 1, 1, '<p>ഇത് കൂടാതെ വേറെ വാഹനങ്ങൾ ഉണ്ടോ ?</p><p>What other vehicles do you own?/Do you have vehicles other than this?</p>', '<p>ഉണ്ടെങ്കിൽ details collect ചെയ്യുക</p>', 0, 0, 14, 1, 0, '2019-04-27 10:41:05'),
(13, 8, 0, 1, 2, '<p><strong>ഇതെല്ലാം നിലനിർത്തികൊണ്ടല്ലേ സാർ ഈ കാർ വാങ്ങിക്കാൻ ഉദ്ദേശിക്കുന്നത്</strong><strong>? Are you decided to get new car\nwhile keeping these cars/Are you planning to buy new one by maintaining the old\none.</strong></p>', '<p>for getting whether it exchange or not</p>', 1, 1, 10, 1, 0, '2019-04-27 10:44:58'),
(14, 8, 0, 1, 1, '<p>സാറിന്റെ വീട്ടിൽ ആരൊക്കെ ഉണ്ട് ?<span class=\"redactor-invisible-space\">അവരൊക്കെ എന്ത് ചെയ്യുന്നു ?<span class=\"redactor-invisible-space\">How many of them are in your family\nand what are their activities?/Your dependent and their activities?</span></span></p>', '', 0, 0, 11, 1, 0, '2019-04-27 11:02:50'),
(16, 8, 0, 1, 1, '<p>ഇതിൽ ആരെല്ലാം ആണ് വാഹനത്തിന്റെ കാര്യത്തിൽ താല്പര്യമുള്ളത് ?<span class=\"redactor-invisible-space\"> In your family who all are\ninterested in vehicles?Are they interested in vehicles?</span></p>', '', 0, 0, 12, 1, 0, '2019-04-27 11:04:50'),
(17, 8, 0, 1, 1, '<p>അവരൊക്കെ വാഹനം ഉപയോഗിക്കാറുണ്ടോ ? Does everyone use vehicles?/<strong> </strong>Apart from you who will drive the vehicle?<span class=\"redactor-invisible-space\"></span></p>', '', 1, 0, 14, 1, 0, '2019-04-27 11:05:23'),
(18, 8, 0, 1, 2, '<p>പുതിയ ഒരു വണ്ടി എടുക്കാനുള്ള താല്പര്യം എന്താണ് ?<span class=\"redactor-invisible-space\">May I ask you why are you\ninterested in buying a new car/what made you decide to get a new car?<span class=\"redactor-invisible-space\"></span></span></p>', '', 0, 1, 33, 1, 0, '2019-04-27 11:06:19'),
(19, 8, 0, 1, 2, '<p>സാർ ഇപ്പോൾ എടുക്കാൻ ഉദ്ദേശിച്ചിട്ടുള്ള  വാഹനം ഏതാണ്? Are there any specific makes or</p><p>models you are interested in?/Which vehicle are you planning to buy?</p>', '<p>Brand, Product, കളർ </p><p>We don’t have the same product ask the next question.<br></p>', 0, 1, 33, 1, 0, '2019-04-27 11:10:06'),
(20, 8, 0, 1, 2, '<p>ഇതിലക്കായി സാർ എത്രയാണ് invest ചെയ്യാൻ ഉദ്ദേശിക്കുന്നത് ?  <span class=\"redactor-invisible-space\">How much are you\nplanning to invest in this?/ How\nwere you thinking of paying for your new vehicle/ What was your investment to\nyour new vehicle?</span></p>', '<p>They didn’t give clarity ask [Closed Prob]</p>', 0, 1, 33, 0, 0, '2019-04-27 11:11:23'),
(21, 8, 0, 1, 2, '<p>ഇതേ segment ൽ ഉള്ള മറ്റുള്ള brand ലെ vehicles  എന്ത്കൊണ്ട് സാർ ഇഷ്ടപ്പെടുന്നില്ല ?<span class=\"redactor-invisible-space\">Why don’t you like in other brand vehicles of\nthe same segment?</span></p>', '', 0, 0, 24, 1, 0, '2019-04-27 11:13:27'),
(22, 8, 0, 1, 2, '<p>Deal conform  ആയാൽ സാർ തന്നെ അല്ലെ payment ചെയ്യുക? If confirm the deal then you yourself will be the payer<span class=\"redactor-invisible-space\">?<span class=\"redactor-invisible-space\"></span></span></p>', '<p>(Payment Mode) <strong>[Money]</strong><strong>If not Why who ?</strong><span class=\"redactor-invisible-space\"></span></p>', 0, 1, 33, 1, 0, '2019-04-27 11:16:13'),
(23, 8, 0, 1, 2, '<p>സാറിനു വാഹനങ്ങളിലുള്ള താല്പര്യംകൊണ്ടാകും ഇങ്ങനെ ഒരു തീരുമാനം എടുത്തത് അല്ലെ ?Your craze or interest in vehicles leads you to such a decision?<span class=\"redactor-invisible-space\"></span></p>', '<p><strong>[Need]</strong></p>', 0, 0, 34, 1, 0, '2019-04-27 11:17:12'),
(24, 8, 0, 1, 2, '<p>സാറിന്റെ സെലക്ഷനിൽ അവർ (Family Members – As discussed above) happy ആകും ല്ലേ ? Will there be anyone else involved in the decission regarding your new vehicle or will it just be yourself.Aren’t they happy in your decision?<span class=\"redactor-invisible-space\"></span></p>', '<p><strong>Authority</strong></p>', 0, 0, 41, 1, 0, '2019-04-27 11:18:23'),
(26, 8, 0, 1, 3, '<p>വണ്ടി വിൽക്കാൻ തീരുമാനിച്ച കാരണം എന്താണ് <span class=\"redactor-invisible-space\">? What is your reason behind trading your vehicle?</span></p>', '', 0, 0, 23, 1, 0, '2019-04-27 11:23:27'),
(27, 8, 0, 1, 1, '<p>അവർ എന്താ സാറിന്റെ കൂടെ വരാതിരുന്നത് ? ഉണ്ടെങ്കിൽ എല്ലാവരും വാഹനത്തിൽ താല്പര്യം ഉള്ള ആളുകൾ ആകും അല്ലെ ?Why didn’t they accompany you? if yes, Everybody will be interested in vehicles,right?</p>', '', 0, 0, 35, 1, 0, '2019-04-27 11:36:04'),
(28, 8, 0, 1, 4, '<p>ഇതേ segment ൽ ഉള്ള മറ്റുള്ള brand ലെ vehicles എന്ത്കൊണ്ട് സാർ ഇഷ്ടപ്പെടുന്നില്ല ?<span class=\"redactor-invisible-space\">Why don’t you like in other brand vehicles of the same segment?</span></p>', '', 0, 0, 16, 1, 0, '2019-04-27 11:39:18'),
(29, 8, 0, 1, 4, '<p>സാർ ഇപ്പോൾ എടുക്കാൻ ഉദ്ദേശിച്ചിട്ടുള്ള വാഹനം ഏതാണ്? Are there any specific makes or</p><p>models you are interested in?/Which vehicle are you planning to buy?</p>', '<p>Brand, Product, കളർ</p><p>We don’t have the same product ask the next question.</p>', 0, 1, 33, 1, 0, '2019-04-27 11:41:04'),
(30, 8, 0, 1, 4, '<p>ഇതിലക്കായി സാർ എത്രയാണ് invest ചെയ്യാൻ ഉദ്ദേശിക്കുന്നത് ? <span class=\"redactor-invisible-space\">How much are you planning to invest in this?/ How were you thinking of paying for your new vehicle/ What was your investment to your new vehicle?</span></p>', '<p>They didn’t give clarity ask [Closed Prob]</p>', 0, 1, 33, 0, 0, '2019-04-27 11:42:27'),
(33, 8, 0, 1, 4, '<p>സാറിന്റെ സെലക്ഷനിൽ അവർ (Family Members – As discussed above) happy ആകും ല്ലേ ? Will there be anyone else involved in the decission regarding your new vehicle or will it just be yourself.Aren’t they happy in your decision?</p>', '<p>Authority</p>', 0, 0, 30, 1, 0, '2019-04-27 12:10:20'),
(34, 8, 0, 1, 4, '<p>സാറിന്റെ വണ്ടിക്ക് സാർ പ്രധീക്ഷിക്കുന്ന വില എന്താണ്?What is your asking for your vehicle?<span class=\"redactor-invisible-space\"></span></p>', '', 0, 0, 31, 1, 0, '2019-04-27 12:19:49'),
(35, 8, 0, 1, 3, '<p>സാറിന്റെ വണ്ടിക്ക് സാർ പ്രധീക്ഷിക്കുന്ന വില എന്താണ്?What is your asking for your vehicle?</p>', '', 0, 0, 32, 1, 0, '2019-04-27 12:19:51'),
(39, 8, 0, 1, 3, '<p>Royal Drive ന്റെ rate ഇപ്പോൾ പറഞ്ഞാൽ അതിന്റെ തീരുമാനം സാർ ഇപ്പോൾ തന്നെ തരുമല്ലോ അല്ലെ?If we say our Rd price now then you will make your descission now itself?<span class=\"redactor-invisible-space\"></span></p>', '<p><strong>Authority</strong></p>', 0, 0, 36, 1, 0, '2019-04-27 12:29:19'),
(37, 8, 0, 1, 3, '<p>Payment mode സാർ എങ്ങനെ ആണ് ഉദ്ദേശിക്കുന്നത്<span class=\"redactor-invisible-space\">?Which mode is you decided to accept payment/What is your payment mode<span class=\"redactor-invisible-space\">?</span></span></p>', '<p><strong>Money</strong></p>', 0, 0, 3, 1, 0, '2019-04-27 12:25:22'),
(48, 8, 0, 1, 3, '<p>സാറിന്റെ പേരിൽ തന്നെ അല്ലെ ഈ വണ്ടി ? Is the vehicle registered in your name<span class=\"redactor-invisible-space\">?</span></p>', '', 1, 0, 42, 1, 0, '2019-05-02 10:52:59'),
(49, 8, 0, 1, 4, '<p>സാറിനു വാഹനങ്ങളിലുള്ള താല്പര്യംകൊണ്ടാകും ഇങ്ങനെ ഒരു തീരുമാനം എടുത്തത് അല്ലെ ?Your craze or interest in vehicles leads you to such a decision?</p>', '<p>[Need]</p>', 0, 0, 43, 1, 0, '2019-05-02 11:21:45'),
(45, 8, 0, 1, 4, '<p>Deal conform ആയാൽ സാർ തന്നെ അല്ലെ payment ചെയ്യുക? If confirm the deal then you yourself will be the payer<span class=\"redactor-invisible-space\">?</span></p>', '<p>(Payment Mode) [Money]If not Why who ?</p>', 0, 1, 33, 1, 0, '2019-05-02 10:44:36');
